    "2015-12-20T18:54:31.128374",nt"name": "espiritu-santo-vanuatu-stable-isotope-delta-18o-delta-13c-data-for-1806-to-1979",nt"isopen":
    false,nt"url": null,nt"notes": "Site: Espiritu Santo Island, Vanuatu, 15S,
    167E. 173 year record of d18O and d13C. Variable names: QSR Age, QSR 13C, QSR 18O,
    GRL Age, GRL Qtrly 13C, GRL Qtrly 18O, Year, MA-13C-2y, MA-18O-2y, MA-13C-4y, MA-18O-4y.
    Variable unit: per mil relative to PDB. Data precision better than 0.8 per mil for
    both 13C and 18O. Data format: Excel file. Description of data : Stable isotopic
    analyses were done at the University of Michigan. Powdered coralline aragonite samples
    (~ 100 mg) were vacuum roasted for one hour at 200 deg C before isotopic analysis.
    Samples were reacted with anhydrous phosphoric acid at 75 deg C in individual reaction
    vessels of a CarboKiel carbonate extraction system coupled to the inlet of a MAT
    251 mass spectrometer. Precision ( &oacute; 1 s) was monitored by daily analyses
    of a powdered calcite standard (NBS-20), and was better than 0.08 0/00 for both
    carbon and oxygen. Values are reported in standard d notation relative to the Chicago
    PDB standard. Ages were derived from annual density banding.",nt"license_title":
